import React, { useState } from "react";

const Appforms = () =>{


    const [name, setName] = useState("");

    const Name = () => {

        setName(name);

    }

    return (

        <>
        <h1>"hello {name}"</h1>
        <input type="text" placeholder="Enter Name"
        
        />
        <button onClick={Name}></button>
        </>
    );


}

export default Appforms;
